import { ListItem } from 'react-native-elements'
import { View } from 'react-native'
import AddEquipment from './AddEquipment';
import React from 'react'
const list = [
    {
      name: 'Crane XVW-1670',
      avatar_url: 'https://constructionreviewonline.com/wp-content/uploads/2015/06/cranes.jpg',
      subtitle: 'Total Sales: 10',
      value : "12"
    },
    {
      name: 'Excavator',
      avatar_url: 'https://i.ytimg.com/vi/XN7CWdXrPto/maxresdefault.jpg',
      subtitle: 'Total Sales : 34',
      value : "56"
    },
    {
      name: 'Bulldozer',
      avatar_url: 'https://i.ytimg.com/vi/XN7CWdXrPto/maxresdefault.jpg',
      subtitle: 'Total sales : 3',
      value : "5"
    }
  ]
const OwnerInventory = ({ navigation }) => {
    return (
        <View>
             {
            list.map((l, i) => (
            <ListItem
                key={i}
                leftAvatar={{ source: { uri: l.avatar_url } }}
                title={l.name}
                badge = {{ value: 3, status : "error", textStyle: { color: 'green' }, containerStyle: { marginTop: -20 } }}
                subtitle={l.subtitle}
                bottomDivider
                chevron
                onPress = {()=>navigation.navigate('AddEquipment', {name : l.name, spec : "telematics Enabled"})}
            />
            ))
        }
        </View>
    )
}

export default OwnerInventory;
